      <div class="home-text">
          <h2>Olá, mundo!</h2>
          <p> Eu sou Ramon, um entusiasta Desenvolvedor Front-End com paixão por design e tecnologia. Desde que mergulhei no mundo da programação, fiquei fascinado pela maneira como as interfaces digitais se manifestam e interagem com os usuários. Minha jornada começou com o desejo de criar experiências incríveis na web e evoluiu para um compromisso de me tornar um futuro desenvolvedor full stack.</p>
      </div>
